import Slider from 'react-slick'

export const Testimonial = () => {
  return (  
    <Slider>
        <div className='testimonial py-4 px-3'>
            <p>
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Quasi inventore dolorum fugiat repudiandae explicabo! Itaque voluptatibus ipsam in iste consectetur quo dolorem praesentium, at labore ducimus magni quis numquam earum.
            </p>
        </div>
    </Slider>
  )
}
